def comma_predecessor(n): # A367614(n)
    y = int(str(n)[0])
    x = (n-y)%10
    k = n - y - 10*x
    kk = k + 10*x + y-1
    return k if k > 0 and int(str(kk)[0]) != y-1 else -1
def a(n):
    an = n
    while (cp:=comma_predecessor(an)) > 0: an = cp
    return an
